import styled from "styled-components";

const CardDiv = styled.div`
  display: flex;
  flex-direction: column;
  padding: 15px;
`;

const Card = ({ className,label, title, picture }) => {
  return (
    <CardDiv className={className}>
      <span>{label}</span>
      <img src={picture} alt="freelance" height={80} width={80} />
      <span>{title}</span>
    </CardDiv>
  );
};

export default Card;
